import React from "react";
import { useReactTable, getCoreRowModel,flexRender,} from "@tanstack/react-table";
import copperData from "./COPPER.json";
import brassData from "./BRASS.json";

const columns = [

  {
    accessorKey: "type",
    header: "Type",
  },
  {
    accessorKey: "price",
    header: "Price/lb.",
  },

];
//Copper Table
export default function CopperTable() {
  const table = useReactTable({
    data: copperData,
    columns,
    getCoreRowModel: getCoreRowModel(),
  });

  //Brass Table
  const brassTable = useReactTable({
    data: brassData,
    columns,
    getCoreRowModel: getCoreRowModel(),
  });

   const renderTable = table => (
    <table style={{ borderCollapse: "collapse", width: "100%", marginBottom: 32 }}>
      <thead>
        {table.getHeaderGroups().map(headerGroup => (
          <tr key={headerGroup.id}>
            {headerGroup.headers.map(header => (
              <th
                key={header.id}
                style={{ border: "1px solid #ccc", padding: "8px" }}
              >
                {flexRender(
                  header.column.columnDef.header,
                  header.getContext()
                )}
              </th>
            ))}
          </tr>
        ))}
      </thead>

      <tbody>
        {table.getRowModel().rows.map(row => (
          <tr key={row.id}>
            {row.getVisibleCells().map(cell => (
              <td
                key={cell.id}
                style={{ border: "1px solid #ccc", padding: "8px" }}
              >
                {flexRender(
                  cell.column.columnDef.cell ??
                    cell.column.columnDef.accessorKey,
                  cell.getContext()
                )}
              </td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );




  return (
   <div>

    <h1>Copper</h1>
    <h3>Prices As Of 12/15/25</h3>
    <table style={{ borderCollapse: "collapse", width: "100%" }}>
      <thead>
        {table.getHeaderGroups().map(headerGroup => (
          <tr key={headerGroup.id}>
            {headerGroup.headers.map(header => (
              <th
                key={header.id}
                style={{ border: "1px solid #ccc", padding: "8px" }}
              >
                {flexRender(
                  header.column.columnDef.header,
                  header.getContext()
                )}
              </th>
            ))}
          </tr>
        ))}
      </thead>

      <tbody>
        {table.getRowModel().rows.map(row => (
          <tr key={row.id}>
            {row.getVisibleCells().map(cell => (
              <td
                key={cell.id}
                style={{ border: "1px solid #ccc", padding: "8px" }}
              >
                {flexRender(
                  cell.column.columnDef.cell ??
                    cell.column.columnDef.accessorKey,
                  cell.getContext()
                )}
              </td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>

    <h1>Other Scrap Categories</h1>
    <h2>Brass</h2>
    </div>
  );
}
